package com.umang.model;

public class Disease {
	public int id,how_rare,danger_level;
	public String name;
	
	
	public Disease() {
		// TODO Auto-generated constructor stub
	}
	
	
	
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public int getHow_rare() {
		return how_rare;
	}
	public void setHow_rare(int how_rare) {
		this.how_rare = how_rare;
	}
	public int getDanger_level() {
		return danger_level;
	}
	public void setDanger_level(int danger_level) {
		this.danger_level = danger_level;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}

}
